import styled from 'styled-components';

export default styled.input`
  width: 100%;
  font-size: 1.13rem;
  color: #8298b9;
  border: none;
  border-bottom: 2px solid #dbe0e8;

  ::placeholder {
    color: #8298b9;
  }
`;
